export class Endereco {
    constructor(loradouro, bairro, cidade, uf, cep, numero, complemento) {
        this.loradouro = loradouro;
        this.bairro = bairro;
        this.cidade = cidade;
        this.uf = uf;
        this.cep = cep;
        this.numero = numero;
        this.complemento = complemento;
    }
}
